import {
  LayerGroup,
  LayersControl,
  Marker,
  Tooltip,
  TileLayer,
  Popup,
} from "react-leaflet";
import { L, Icon } from 'leaflet';
import bannerRed from '../../assets/images/bannerRed.png';


const Map = ({ zoom, coords }) => {

  return (
    <LayersControl position="topright">
      <LayersControl.BaseLayer checked name="Basemap">
        <TileLayer url="tiles/{z}/{x}/{y}.png" noWrap={true} />
      </LayersControl.BaseLayer>
      <Marker position={[-100, 65]} icon={new Icon({
            iconUrl: bannerRed,

            iconSize: [50, 50],
            iconAnchor: [30, 94],
            popupAnchor: [-3, -76]
      })}>
        <Popup>
          Rockholm
        </Popup>
      </Marker>
    </LayersControl>
  );
};
export default Map;
